    //   <div className={styles.acknowledgement}>
    //     <div className='container text-center'>
    //       <p>
    //         &copy; 2020 Issaaf Kattan React Land Page Template. Design by{' '}
    //         <a href='http://www.templatewire.com' rel='nofollow'>
    //           TemplateWire
    //         </a>
    //       </p>
    //     </div>
    //   </div>
    // </div>
  )
}
